

SET statement_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;
SET default_with_oids = false;


CREATE TABLE dennys (
    uid bigint NOT NULL,
    address1 text,
    address2 text,
    city text,
    state text,
    country text,
    latitude double precision,
    longitude double precision,
    shape public.geometry(Point,4326)
);

CREATE TABLE laquinta (
    oid integer NOT NULL,
    city text,
    type text,
    latitude double precision,
    longitude double precision,
    state text,
    shape public.geometry(Point,4326)
);

CREATE VIEW dlq_pairs AS
    SELECT DISTINCT d.uid, d.city, d.state, (public.st_transform(d.shape, 2163) OPERATOR(public.<->) public.st_transform(l.shape, 2163)) AS distance, public.st_makeline(d.shape, l.shape) AS shape FROM dennys d, laquinta l WHERE ((public.st_transform(d.shape, 2163) OPERATOR(public.<->) public.st_transform(l.shape, 2163)) < (150)::double precision);

CREATE SEQUENCE laquinta_oid_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;

ALTER SEQUENCE laquinta_oid_seq OWNED BY laquinta.oid;

ALTER TABLE ONLY laquinta ALTER COLUMN oid SET DEFAULT nextval('laquinta_oid_seq'::regclass);






SELECT pg_catalog.setval('laquinta_oid_seq', 833, true);

ALTER TABLE ONLY dennys
    ADD CONSTRAINT dennys_pkey PRIMARY KEY (uid);

ALTER TABLE ONLY laquinta
    ADD CONSTRAINT laquinta_pkey PRIMARY KEY (oid);